import React, { useEffect } from 'react'
import Staffnavbar from "./Staffnavbar"
import '../styles/Profile.css'
import { useNavigate } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import { staffLogout } from '../../redux/staff/Actions';
import axios from 'axios';

const Staffportal = () => {
let token=sessionStorage.getItem("student_token");

const navigate = useNavigate();
let dispatch=useDispatch();
let logout=()=>{
sessionStorage.removeItem("staff_token");
dispatch(staffLogout());
navigate('/');
}


//fetch the student data
let getuser=()=>{
// dispatch(listLoading())
  axios({
    method: "get",
    url: 'http://localhost:8000/managerapi/getloggedinstaff/',
    data:{
    Email:token.email,
    Password:token.Password,
    }
}).then((response)=>{
  // dispatch(listSuccess(response.data));
  console.log(response.data);
}).catch((error)=>{
  // dispatch(listError());
  let errmessage=error.response.data.Email;
  alert("Error :"+errmessage);
})
}
useEffect(()=>{
  getuser();
},[])

  return (
    <>
       <Staffnavbar/>
       <div className='profile-wrapper'>
       <h3 style={{color:"#28a745", textAlign:"center",fontSize:"2vw",padding:'0px',margin:'0px',fontWeight:"500"}}>Profile</h3>
          <div className='profile-main'>
          <div className="profile">
          <p className='profile-label'>Name</p>

          <p className='profile-label'>Email</p>

          <p className='profile-label'>Staff ID</p>
          </div>
          <div className="profile2">

          <p className='profile-info'>Utsav Katiyar</p>

          <p className='profile-info'>utsav.katiyar@livehealth.in</p>

          <p className='profile-info'>436</p>

          </div>
          </div>
        <div style={{width:"fit-content",marginRight:"0px",marginLeft:"auto"}}>
        <button className='profile-button' >Edit</button>
        <button className='profile-button' onClick={logout}>Log Out</button>
        </div>
       </div>
    </>
  )
}

export default Staffportal
